import React from "react";
import { FirstName } from "./App";

const ComC = () => {
    return (
        <>
            <FirstName.Consumer> {(fname) => {
                return (
                    <h1>Hello World!{fname}</h1>
                )

            }}</FirstName.Consumer>
            <p> Flare On Top</p>
        </>
    )
}

export default ComC;
